        while all((0 < e < 7 for e in a)):
            a = [a[0] - 1, a[1] - m]
        while all((0 < e < 7 for e in b)):
            b = [b[0] + 1, b[1] + m]
    return sorted([coords_to_chess(a), coords_to_chess(b)])

